const SneakersPage = (props) => {
    const {allSneakers}=props;
    return (  
        <>
        <section className="sneakers-container">
            {allSneakers.map((sneakers)=>{
                return(
                    <div key={sneakers.id}>
                       Name: {sneakers.name}
                       Brand: {sneakers.brand}
                    </div>
                )
            })}
        </section>
        </>
    );
}
 
export default SneakersPage;
